import { HangboardScale } from "@/core/hangboardscale";
import { pipe, tared, passTrough } from '@/core/messagetransformer';
import { WeightMessage, ScaleOptions } from '@/core/sensorreader';
import { LinearRegressionFromData } from '@/core/history';
import { BenchmarkGraphData, TareWeights } from '@/components/typeexports';
import { LinRegType, avg } from '@/core/math';

export enum SignalProcessorEvents {
    STARTED = 1,
    RISE,
    RISE_END,
    WEIGHT_DROP,
    WEIGHT_INCREASE,
    TOP,
    TOP_END,
    ERROR_START_TIMEOUT,
    ERROR_NON_ZERO_SCALE,
    INVALID
}

export interface ProcessingEvent {
    type:SignalProcessorEvents;
    index:number;
    time:number;
}

export type ProcessingCallback = (type:SignalProcessorEvents, index:number, time:number) => void;

enum SignalProcessorState {
    INIT = 1,
    SEARCH_FIRST_RISE,
    SEARCH_RISE,
    SEARCH_TOP,
    SEARCH_WEIGHT_DROP,
    SEARCH_FALL_START,
    DONE,
    INVALID
}

class SignalProcessor {

    state:SignalProcessorState = SignalProcessorState.INIT;
    searchIndex:number = 0;
    weightAtTop:number = 0;
    topFoundIndex:number = 0;    
    minWeight:number = 20; //kg
    forceAbortFactor:number = 0.95;
    raiseSampleCount:number = 10; // 125ms
    nonzeroSampleCount:number = 80;
    avgWeightSamples:number = 20;
    startTimeoutDuration:number = 60; //s

    constructor() {}

    onlyPositive(arr:Array<number>) {
        for(let i = 0; i < arr.length; i++) {
            if(arr[i] <= 0) {
                return false;
            }
        }
        return true;
    }

    onlyNegative(arr:Array<number>) {
        for(let i = 0; i < arr.length; i++) {
            if(arr[i] > 0) {
                return false;
            }
        }
        return true;
    }    

    reset() {
        this.searchIndex = 0;
        this.weightAtTop = 0;
        this.topFoundIndex = 0;
        this.state = SignalProcessorState.INIT;
    }

    isStableNonZero = (x:number[], y:number[]) => {
        let lr = LinearRegressionFromData(x, y);
        let w = avg(y);
        if(Math.abs(lr.slope) < 1 && w > 10) {
            return true;
        }
        return false;
    }

    timeToSamples(time:number) {
        return Math.ceil(time * ScaleOptions.RAW_DATA_RATE);
    }

    runSearchRiseLogic(time:Array<number>, weight:Array<number>, gradient:Array<number>, cb:ProcessingCallback) {
        if(time.length - this.searchIndex >= this.raiseSampleCount) {
            let searchStartIdx = this.searchIndex;
            let endSearchIdx = this.searchIndex + this.raiseSampleCount;
            let lastIdx = endSearchIdx - 1;
            let gData = gradient.slice(searchStartIdx, endSearchIdx);
            if(this.onlyPositive(gData)) {
                console.log(`rise found @ ${time[searchStartIdx]}`);
                cb(SignalProcessorEvents.RISE, searchStartIdx, time[searchStartIdx]);
                this.state = SignalProcessorState.SEARCH_TOP;
            }
            this.searchIndex++;
        }
    }

    onNewSample(time:Array<number>, weight:Array<number>, gradient:Array<number>, cb:ProcessingCallback) {
        // we look for a gradient where every sample is > 0, we then count this as "rising", then we look for 
        // a gradient change in sign, this is our "top". from there we wait untill the weight drops below 90%
        // or rises above 110%, if it rises we restart if it drops we count it as "end found" and walk the
        // gradient backwards until we find a sign change again, this is our "end top"
        if(this.state === SignalProcessorState.INIT) {
            console.log(`start @ ${time[this.searchIndex]}`);
            cb(SignalProcessorEvents.STARTED, this.searchIndex, time[this.searchIndex]);
            this.state = SignalProcessorState.SEARCH_FIRST_RISE;
        }
        else if(this.state === SignalProcessorState.SEARCH_FIRST_RISE) {
            if(time.length >= this.nonzeroSampleCount) {
                let searchStartIdx = time.length - this.nonzeroSampleCount - 1;
                let endSearchIdx = time.length;
                let last = endSearchIdx - 1;
                let t = time.slice(searchStartIdx, endSearchIdx);
                let w = weight.slice(searchStartIdx, endSearchIdx);
                if(this.isStableNonZero(t, w)) {
                    console.log(`nonzero stable @ ${time[last]}, ${avg(w)}kg`);
                    cb(SignalProcessorEvents.ERROR_NON_ZERO_SCALE, last, time[last]);
                    this.state = SignalProcessorState.INVALID;
                    return;
                }
            }
            if(this.searchIndex >= this.timeToSamples(this.startTimeoutDuration)) {
                let last = this.searchIndex - 1;
                cb(SignalProcessorEvents.ERROR_START_TIMEOUT, last, time[last]);
                this.state = SignalProcessorState.INVALID;
                return;
            }
            this.runSearchRiseLogic(time, weight, gradient, cb);
        }
        else if(this.state === SignalProcessorState.SEARCH_RISE) {
            this.runSearchRiseLogic(time, weight, gradient, cb);
        } 
        else if(this.state === SignalProcessorState.SEARCH_TOP) {
            // after we vont the 20 rising samples we look for a non > 0 sample and count this as the start
            // of the benchmark period
            if(gradient[this.searchIndex] <= 0 && weight[this.searchIndex] >= this.minWeight) {
                // if the gradient for the current point is zero, it means the point before
                // was the last one with a positive gradient
                let topPoint = this.searchIndex - 1;
                console.log(`rise end/top found @ ${time[topPoint]}, ${weight[topPoint]}kg`);
                this.weightAtTop = weight[topPoint];
                cb(SignalProcessorEvents.RISE_END, topPoint, time[topPoint]);
                cb(SignalProcessorEvents.TOP, topPoint, time[topPoint]);
                this.topFoundIndex = topPoint;
                this.state = SignalProcessorState.SEARCH_WEIGHT_DROP;
            } else {
                this.searchIndex++;
            }
        } else if(this.state === SignalProcessorState.SEARCH_WEIGHT_DROP) {
            // seeing weight below 90% max we assume the benchmark ended and start the fall_start searching
            if(weight[this.searchIndex] < this.weightAtTop * 0.90) {
                console.log(`weight threshold found @ ${time[this.searchIndex]}, ${weight[this.searchIndex]}kg`);
                cb(SignalProcessorEvents.WEIGHT_DROP, this.searchIndex, time[this.searchIndex]);
                this.state = SignalProcessorState.SEARCH_FALL_START;
            // if the weight raises 10% above the initial found max we assume it was localized and restart the search
            } else if(weight[this.searchIndex] > this.weightAtTop * 1.10) {
                console.log(`weight increase, restart search @ ${time[this.searchIndex]}, ${weight[this.searchIndex]}kg`);
                cb(SignalProcessorEvents.WEIGHT_INCREASE, this.searchIndex, time[this.searchIndex]);
                this.state = SignalProcessorState.SEARCH_RISE;
            }
            this.searchIndex++;
        }
        else if(this.state === SignalProcessorState.SEARCH_FALL_START) {
            // as the "END_BY_WEIGHT" point is too late in time we search from there on backwards
            // to find the point where the gradient changes (from <= to > 0), this is the boundary
            // condition of the benchmark "active" time
            let startSign = Math.sign(gradient[this.searchIndex]);
            //TODO: make sure bounds are always correct
            let found = false;
            let distanceToTop = this.searchIndex - this.topFoundIndex;
            for(let i = 0; i < distanceToTop; i++) {
                let idx = this.searchIndex - i;
                let grad = gradient[idx];
                if(startSign !== Math.sign(grad)) {
                    console.log(`end found @ ${time[idx]}, ${weight[idx]}kg`);
                    cb(SignalProcessorEvents.TOP_END, idx, time[idx]);
                    found = true;
                    break;
                }
            }
            if(!found) {
                console.log(`no end using weight threshold @ ${time[this.searchIndex]}, ${weight[this.searchIndex]}kg`);
                cb(SignalProcessorEvents.INVALID, this.searchIndex, time[this.searchIndex]);
                this.state = SignalProcessorState.INVALID;
            }
            this.state = SignalProcessorState.DONE;
        }
    }
}

